import React, { Component } from 'react';
import ReactDOM from 'react-dom';
// import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import { BrowserRouter, Route, Switch } from 'react-router-dom';


// index.js
ReactDOM.render(
  <BrowserRouter>
  <App/>
</BrowserRouter>,
document.getElementById('root')
);

  

